import { createComponent } from 'js/declViewModelService';
import { registerDynImportEntry } from 'js/moduleLoader';
import AwParseService from 'js/awParseService';
import AwFilterService from 'js/awFilterService';
import { getField } from 'js/utils';
import { Fragment } from 'react';
let filterSer = AwFilterService.instance;



/*
render function
*/
import { awCommandBarRenderFunction } from 'js/AwCommandBarService';


/*
ctx imports
*/

const ctxImportObj = {  };


/*
dynamic import
 */
registerDynImportEntry('js/AwCommandBarService', () => import('js/AwCommandBarService'));;

/*
view model
 */
const declViewModelJson = {
    "schemaVersion": "1.0.0",
    "actions": {
        "initialize": {
            "actionType": "JSFunctionAsync",
            "deps": "js/AwCommandBarService",
            "method": "awCommandBarInitFunction",
            "inputData": {
                "0": {
                    "anchor": "{{props.anchor}}"
                }
            },
            "outputData": {
                "commandList": "commandList",
                "trace": "trace"
            }
        },
        "refreshServerVisibility": {
            "actionType": "JSFunctionAsync",
            "deps": "js/AwCommandBarService",
            "method": "refreshServerVisibility",
            "inputData": {
                "0": {
                    "anchor": "{{props.anchor}}",
                    "commandList": "{{data.commandList}}",
                    "visibilityLoader": "{{props.visibilityLoader}}",
                    "trace": "{{data.trace}}"
                }
            },
            "outputData": {
                "visibleServerCommands": ""
            }
        },
        "render": {
            "method": "awCommandBarRenderFunction",
            "options": {
                "elementRefList": [
                    "commandBar"
                ]
            },
            "deps": "js/AwCommandBarService"
        }
    },
    "lifecycleHooks": {
        "onMount": "initialize",
        "onUpdate": {
            "action": "refreshServerVisibility",
            "observers": [
                "props.visibilityLoader",
                "viewModel.data.commandList"
            ]
        },
        "render": "render"
    },
    "props": {
        "alignment": {
            "type": "string"
        },
        "anchor": {
            "type": "string"
        },
        "reverse": {
            "type": "object"
        },
        "show-command-labels": {
            "type": "object"
        },
        "context": {
            "type": "object"
        },
        "hide-more": {
            "type": "object"
        },
        "overflow": {
            "type": "object"
        },
        "visibility-loader": {
            "type": "object"
        }
    },
    "_viewModelId": "AwCommandBar",
    "_uniqueViewModelId": "AwCommandBar",
    "ctx": {}
};




/*
define component
*/
const Component = createComponent( declViewModelJson, awCommandBarRenderFunction, {"elementRefList":["commandBar"]}, ctxImportObj );

export default Component;
